import Mock from 'mockjs'
const Random = Mock.Random;

//  // 获取检验单列表
//  GetCheckReport: {url: '/CheckReport/GetCheckReport', method: 'post'},
//  // 获取批次列表
//  GetBatchList: {url: '/CheckReport/GetBatchList', method: 'post'},
//  // 检验单新增&编辑
//  SaveCheckReport: {url: '/CheckReport/SaveCheckReport', method: 'post'},
//  // 检验单删除
//  delCheckReport: {url: '/CheckReport/delCheckReport', method: 'post'},
// 获取单个检验单信息
// CheckReport: {url: '/CheckReport/GetCheckReportById', method: 'post'},

var GetCheckReport = [];
for (let i = 0; i < 10; i++) {
    let obj = {};
    obj.id = Random.integer(3);
    obj.productName = Random.cword(10);
    obj.productCode = Random.string(16);
    obj.lastMondificationTime = Random.datetime();
    obj.batchNo = Random.string('upper',3) + Random.integer(5);
    GetCheckReport.push(obj);
}

var GetBatchList = [
    {
        "batchId": "e3af1edf9b5b474f8ad59fedfde0149b",
        "batchNo": "CNN100364",
        "productName": '产品名称1'
    },
    {
        "batchId": "e3af1edf9b5b474f8ad59fedfde0149c",
        "batchNo": "CNN100365",
        "productName": '产品名称2'
    },
    {
        "batchId": "e3af1edf9b5b474f8ad59fedfde0149d",
        "batchNo": "CNN100366",
        "productName": '产品名称3'
    }
];

var GetCheckReportById = {
    "id": '1324325',
    // "batchNo": "e3af1edf9b5b474f8ad59fedfde0149b",
    "batchId": "e3af1edf9b5b474f8ad59fedfde0149b",
    "checkReportImg": "data:image/png;base64,",
    "billOfEntryImg": "data:image/png;base64,",
    "taxListImg": "data:image/png;base64,"
}

 //获取检验单列表
 Mock.mock('/CheckReport/GetCheckReport', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "result": { "totalCount": Random.integer(1,100), "items": GetCheckReport }, "success": true, "error": null, "unAuthorizedRequest": false };
});

// 获取批次列表
Mock.mock('/CheckReport/GetBatchList', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "result": GetBatchList, "success": true, "error": null, "unAuthorizedRequest": false };
});

// 检验单新增&编辑
Mock.mock('/CheckReport/SaveCheckReport', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "success": true,"message": ""};
});

// 检验单删除
Mock.mock('/CheckReport/delCheckReport', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "success": true,"message": ""};
});
// 获取生产激活明细
Mock.mock('/CheckReport/GetCheckReportById', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "result": GetCheckReportById,"success": true,"message": ""};
});
